class Solution {
public:
    bool isDigit(string &s, int curr_index) {
        return s[curr_index]>='0' and s[curr_index] <= '9';
    }

    string decodeStringHelper(string &s, int &curr_index) {
        string ans = "";
        int n = s.length();
        while(curr_index < n) {
            int k = 0;

            if(s[curr_index] == ']') return ans;

            // 1. Add the inital characters as it is
            while(curr_index<n and !isDigit(s, curr_index) and s[curr_index] != ']') {
                ans += s[curr_index++];
            }
            if(curr_index >= n or s[curr_index] == ']') return ans;

            // 2. decode the value of k
            while(curr_index < n and isDigit(s, curr_index)) {
                // curr character is a digit
                k *= 10;
                k += (s[curr_index++] - '0'); // convert the current character into integer
            }

            // 3. After decoding the value of 'k'
            // the next character will be '['
            // we will skip this character because we know that our encoded string starts from next index
            if(s[curr_index] == '[') {
                curr_index++;
                string decodedString = decodeStringHelper(s, curr_index);
                // add the decoded string in the answer k times
                for(int i=0;i<k;i++) {
                    ans += decodedString;
                }
            }
            // skipping the ']' parantheses
            curr_index++;
        }
        return ans;
    }

	string decodeString(string s) {
        int curr_index = 0;
        return decodeStringHelper(s, curr_index);
	}
};

