const int N = 1e3+5;
char arr[N][N];


int dx[] = {1 , -1 , 0 , 0};
int dy[] = {0 , 0 , 1 , -1};
char C[] = {'D' , 'U' , 'R' , 'L'};

bool vis[N][N];
int n , m;
string path , ans = "-1";



bool valid (int x , int y  ){
    return x >= 0 && x < n && y >= 0 && y < m && arr[x][y] != '#' && !vis[x][y];
}


void bfs(int ax  , int ay , int bx , int by){

    queue < pair < int , int > > q;
    q.push({ax , ay});
    vis[ax][ay] = 1;
    
    while(!q.empty()){
        auto p = q.front();
        q.pop();
        int x = p.fi , y = p.se;
        for(int i =0 ; i < 4 ; i++){
            int nx = x + dx[i] , ny = y + dy[i];
            
            if(valid(nx , ny)){
                vis[nx][ny] = 1;
                path += C[i];
                q.push({nx,ny});
                if(nx == bx && ny == by){
                    // cout << x << " " << y << " " << nx << " " << ny << nl;
                    // cout << path << nl;
                    
                    path.pop_back();
                    if(sz(path) < sz(ans) or ans =="-1"){
                        ans = path ;
                        path="";
                    }
                    
                }
               
            }
        }
    }
}



void myCode(){



